  width: 240px;
  display: flex;
  padding: 15px 0 18px;
  border-radius: 14px;
  position: relative;

  &--hover {
    background-color: #f6f7fb;

    @media (max-width: 1024px) {
      background: #fff;
    }
  }

  @media (max-width: 525px) {
    width: 100%;
  }

  @media (min-width: 526px) and (max-width: 767px) {
    width: 48%; 
  }

  /*@media (min-width: 768px) and (max-width: 1024px) {
    width: 33%; 
  }*/
}

.inner {
  width: 220px;
  margin: auto;
  flex-direction: column;

  @media (max-width: 525px) {
    width: 100%;
  }

  @media (min-width: 526px) and (max-width: 767px) {
    width: 100%;
  }
}

.icon {
  &-tokens {
    margin-right: 6px;
  }

  &-comments {
    margin-right: 7px;
    top: 3px;
    position: relative;

    &:hover,
    &:active,
    &:focus {
      background: transparent;
    }
  }

  &-like {
    margin-right: 6px;
  }

  &-more {
    display: none;
  }

  &--hover {
    display: block;
  }
}

.title {
  font-weight: 700;
  font-size: 14px;
}

.content {
  &-top {
    position: absolute;
    top: 14px;
    color: #ffffff;
  }

  img {
    border-radius: 14px;
    height: 161px;
    width: 100%;

    @media (max-width: 525px) {
      width: 100%;
      height: 100%;
      min-height: 100%;
    }

    @media (min-width: 526px) and (max-width: 767px) {
      height: auto;
    }
  }

  &-bottom {
    position: absolute;
    bottom: 14px;
  }

  &-main {
    position: relative;
  }

  &-description {
    padding-right: 20px;
    margin: 0;
    font-size: 12px;
    color: #d8d6ff;
  }

  &-hover {
    padding: 16px;
    position: absolute;
    display: none;
    top: 0;
    left: 0;
    width: 220px;
    height: 161px;
    background: rgba(78, 71, 238, 0.85);
    border-radius: 8px;

    @media (max-width: 525px) {
      width: 100%;
      height: 100%;
    }

    @media (min-width: 526px) and (max-width: 767px) {
      width: 100%;
      height: 100%;
    }
  }

  &--hover {
    display: block;
  }
}

.comments {
  &-text {
    font-size: 12px;
    position: relative;
    top: 0px;
  }
}

.badge {
  display: flex;
  align-items: center;
  color: #3b3a3a;
  font-size: 12px;
  height: 28px;
  padding: 0 9px;

  &-btn {
    margin-right: 7px;
    border-radius: 35px;
    border: 1px solid #e0e0e8;

    &:hover,
    &:focus {
      background: transparent;
      border: 1px solid #3b3a3a;
    }

    &:active {
      opacity: 0.5;
    }

    &:last-child {
      margin-right: 0;
    }
  }

  &-text {
    color: #3b3a3a;
    position: relative;
    top: 0px;
    line-height: normal;
    height: 14px;
  }
}

.avatar {
  margin-right: 12px;
  width: 17px;
  height: 17px;
  border-radius: 50%;
}

.header {
  margin-bottom: 5px;
  display: flex;
  align-items: center;
  justify-content: space-between;

  &-link {
    display: flex;
    align-items: center;
    justify-content: space-between;
    width: 100%;

    &:hover,
    &:focus,
    &:active {
      background: transparent;
    }
  }

  &-more {
    &:hover,
    &:focus,
    &:active {
      background: transparent;
    }
  }

  &-title {
    margin: 0;
    color: #3b3a3a;
    font-weight: 400;
    font-size: 12px;
  }

  &-author {
    display: flex;
    align-items: center;
  }
}

.footer {
  margin-top: 18px;
  display: flex;
  align-items: center;
}

.popup {
  &-author {
    width: 320px;
    box-shadow: 0 6px 16px rgba(0, 0, 0, 0.11);
    background-color: #ffffff;
    position: absolute;
    z-index: 1;
    top: 45px;
    border-radius: 8px;

    @media (max-width: 1024px) {
      display: none;
    }

    &:before {
      content: '';
      width: 0;
      height: 0;
      border-left: 10px solid transparent;
      border-right: 10px solid transparent;
      border-bottom: 10px solid white;
      top: -7px;
      left: 8.5px;
      position: absolute;
    }

    &-head {
      display: flex;
      align-items: center;
      justify-content: space-between;
      padding: 19px 19px 0 19px;
    }

    &-avatar {
      width: 29px;
      height: 29px;
      margin-right: 9px;
      border-radius: 50%;
    }

    &-title {
      font-weight: 700;
      font-size: 12px;
      color: #3b3a3a;
      margin: 0;
    }

    &-content {
      margin-top: 17px;
      padding: 0 19px 19px 19px;
      display: flex;
      justify-content: space-between;
      align-items: center;
      flex-wrap: wrap;
    }

    &-badges {
      padding: 16px 19px 17px;
      border-bottom: 1px solid #e7e7ea;
    }

    &-img {
      width: 91px;
      height: 66px;
      border-radius: 8px;
    }
  }
}

@media (max-width: 1024px) {
  .container {
    padding-top: 5px;
    padding-bottom: 32px;
    margin: 0 3px;
  }

  .more-btn {
    padding: 10px 0 10px 10px;
  }


  .icon-more {
    display: block;
  }
}
